import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="header">{/* <h1>my new app</h1> */}</div>
      <div className="sideMenu">
        Side Menu
        <ul>
          <li>My tasks</li>
          <li>Members</li>
          <li>Projects</li>
          <li>Calendar</li>
          <li>Messages</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
